import React from 'react';
import './index.css';

const newLocal = <div className="form-check flex flex-row items-center">
  <input type="checkbox" className="w-4 h-4 rounded-full focus:ring-1" />
  <div className="ml-3">
    <p className="text-base font-medium">Task Name</p>
    <p className="text-xs text-gray-500">Task Description</p>
  </div>
</div>;
function App() {
  return (
    <div className="grid grid-cols-1 gap-4 m-5 justify-center">
      <div>
        <h1 className="text-3xl font-bold font-sans">My Tasks</h1>
      </div>
      {newLocal}
    </div>
  );
}

export default App;
